import React from 'react';
import StudentList from '../components/StudentList'; // Correct path

const Dashboard = () => {
  return (
    <div style={{ display: 'flex', minHeight: '100vh', fontFamily: 'Arial' }}>
      <div style={{ width: '250px', backgroundColor: '#f4f7e6', padding: '20px' }}>
        <h2 style={{ color: 'blue' }}>ADMIN</h2>
        <p>Dashboard</p>
        <p style={{ color: 'purple', fontWeight: 'bold' }}>students</p>
      </div>
      <div style={{ flex: 1, padding: '40px' }}>
        <div style={{ display: 'flex', marginBottom: '30px' }}>
          {/* Tag name must be StudentList */}
          <StudentList title="Regd users" count="10" />
          <StudentList title="Subject Listed" count="12" />
        </div>
        <h2>Hello Admin</h2>
        <div style={{ border: '1px solid #ddd', padding: '20px', borderRadius: '10px' }}>
           <h3>Account Details</h3>
           <p>ðŸ‘¤ Arun Kumar</p>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
